import React from "react";

export default () => {
  return (
    <div style={{ textAlign: "center", marginTop: "20%" }}>
      <h1>Hi, Welcome to Monten!</h1>
      <h2>The best platform to help you manage your money</h2>
      <h3>Our platform allows you to: </h3>
      <ul>
        <li>Easily view your spending by category through out the year </li>
        <li>Easily view and re-categorise your transactions </li>
        <li>Pay your bills online </li>
        <li>Learn more about managing money and investing </li>
      </ul>
    </div>
  );
};
